import react from 'react';
import VideoPop from 'react-video-pop';
import './Demo.css';



const Demo= ({url})=>
{


return (
<>

<div className="demo__video">
<VideoPop Src={url} mute={false} autoplay={true} className='demo'   root="video-root" ratio={{w:16,h:9}} />
</div>
    

</>


)



}


export default Demo;
